import React from 'react';
import Header from '../components/Header';
import Body from '../components/Body';
import Footer from '../components/Footer';

const Home = () => {
    return (
        <div>
            <Header />
            <Body 
                img="./images/doctor2.png" 
            />
            <Body 
                img="./images/header-pic.jpg"/>
            <Footer />
        </div>
    )
};

export default Home;
